import React from 'react';
import {Link} from "react-router-dom";
import './Header.css';

export const Header = ({user}) => {

    return (
        <div>
            <nav className="navbar navbar-dark navbar-expand-lg bg-primary navbar-nav">
                <div className="navbar-brand navbar-title">
                    <span className="navbar-text">Movies App</span>
                </div>
                <ul className="navbar-nav">
                    <li className="nav-item">
                        <Link
                            className="nav-link"
                            to="/trending"
                            exaxt>
                            Trending
                        </Link>
                    </li>
                    <li className="nav-item">
                        <Link
                            className="nav-link"
                            to="/movies">Movies
                        </Link>
                    </li>
                    <li className="nav-item">
                        <Link
                            className="nav-link"
                            to="/series">TV Series
                        </Link>
                    </li>
                    <li className="nav-item">
                        <Link
                            className="nav-link"
                            to="/search">Search
                        </Link>
                    </li>
                    {/*<li className="nav-item">*/}
                    {/*    <Link*/}
                    {/*        className="nav-link"*/}
                    {/*        to="/login"><button>loginIn</button>*/}
                    {/*    </Link>*/}
                    {/*</li>*/}
                </ul>
                <div>
                    {'welcome'}  {user}
                </div>
            </nav>

        </div>

    );
};
